import { Component } from '@angular/core';
import { Post } from '../post';

@Component({
  selector: 'app-post-detail',
  templateUrl: './post-detail.component.html',
  styleUrls: ['./post-detail.component.css']
})
export class PostDetailComponent {
posts: Post[] = [];
post: Post = {
postId: 0,
userId: 0,
categoryId: 0,
title: "",
content: "",
viewCount: 0,
creationDate: "",
isPublished: false
};

constructor()
}
